import React from 'react'
import SimpleImageSlider from 'react-simple-image-slider';
import banner from './bannerimage.json'

const Comp = styled.div``

const BannerImg = () => {
    return (
        <>
            <div className="bannerslider">
                <SimpleImageSlider 
                width={896}
                height={560}
                images={banner}
                showBullets={true}
                showNavs={true}
                autoPlay={true}
                autoPlayDelay={1}
                slideDuration={1}
                style={Comp}
                

                />
            </div>
        </>

    )
}

export default BannerImg;
